	add("epidemiology", "{\"term\":\"epidemiology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From epidemia + οlogy, from Ancient greek (to 1453) \u0027επιδημία\u0027 + \u0027λόγος\u0027 from επί (upon) and δήμος (people) (disease upon people and theory). See also epidemic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of a science dealing with the spread and control of diseases, viruses, concepts etc. throughout populations or systems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The epidemiological body of knowledge about a particular thing\", \"priority\":2}]}, \"synonyms\":{}}");

	add("epidiascope", "{\"term\":\"epidiascope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine that projects images onto a screen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, Lawrence Durrell, \u0027Balthazar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But it was only the huge \u0027\u0027epidiascope\u0027\u0027 which threw upon the farther wall the blazing and magnified images of the photographs which Nimrod himself was feeding into it one by one from an envelope\", \"priority\":3}]}, \"synonyms\":{}}");

