	add("epimyth", "{\"term\":\"epimyth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek \u0027ἐπιμύθιον\u0027, neutral of \u0027ἐπιμύθιος\u0027, from \u0027ἐπί\u0027 ‘upon’ + \u0027μῦθος\u0027 ‘story, fable’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The moral of a story\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1881,\u0027\u0027 William Fleming and Henry Calderwood, \u0027A Vocabulary of the Philosophical Sciences\u0027, page 664\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027epimyth\u0027\u0027, coming after the fable, the moral\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1934,\u0027\u0027 Daniele Vare, \u0027The Quarterly Review\u0027, page 448\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I]t is the Odyssean episode with a Christian \u0027\u0027epimyth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1994,\u0027\u0027 Reb Moshe Walich, \u0027Book of Fables: The Yiddish Fable Collection of Reb Moshe Wallich, Frankfurt Am Main, 1697\u0027, page 19\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In principle each fable in the collection is divided into two parts: the narrative itself, followed by an explicit moral or \u0027\u0027epimyth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In most of the fables the length of the \u0027\u0027epimyth\u0027\u0027 ranges between six and twelve lines\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000,\u0027\u0027 Edward W. Wheatley, \u0027Mastering Aesop: medieval education, Chaucer and his followers\u0027, page 227\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"P]resumably the “man of education” did not reproduce the epimyth of the fable, which warns that one should always anticipate the result of one\u0027s actions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004,\u0027\u0027 Jerold C. Frakes, \u0027Early Yiddish Texts 1100-1750: With Introduction and Commentary\u0027, page 750\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"T]he first five fables follow a different sequence in the two texts, which causes a logical problem in the \u0027\u0027epimyth\u0027\u0027 to fable no. 6 in Wallich\u0027s collection; and tale no. 35 from the earlier collection is omitted by Moses Wallich\", \"priority\":12}]}, \"synonyms\":{}}");

	add("epinephrine", "{\"term\":\"epinephrine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἐπί\u0027 (upon) + \u0027νεφρός\u0027 (kidney) + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A catecholamine hormone and neurotransmitter; as a hormone, secreted by the adrenal gland in response to stress (when it stimulates the autonomic nervous system); as a neurotransmitter, synthesized from norepinephrine\", \"priority\":1}]}, \"synonyms\":{}}");

