	add("episcopacy", "{\"term\":\"episcopacy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From {{m|la|episcopātus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Government of the church by bishops\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027Glencoe\u0027, Amberley 2009, p. 16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Further religious division occurred during the post-Restoration decades in the reign of Charles II, when strenuous and violent efforts were made by the Government to impose an \u0027\u0027episcopacy\u0027\u0027 on the Scottish Church\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bishops collectively; episcopate\", \"priority\":4}]}, \"synonyms\":{}}");

	add("episcopate", "{\"term\":\"episcopate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From \u0027episcopatus\u0027 from Latin \u0027episcopus\u0027 from Ancient greek (to 1453) \u0027ἐπίσκοπος|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bishops seen as a group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The American Roman Catholic \u0027\u0027episcopate\u0027\u0027 regularly meets together\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tenure in office of a bishop\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bishop Smith\u0027s \u0027\u0027episcopate\u0027\u0027 ran for more than 30 years\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A bishop\u0027s jurisdiction, the extent of his diocese\", \"priority\":5}]}, \"synonyms\":{}}");

	add("epistemology", "{\"term\":\"epistemology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἐπιστήμη\u0027 (science, knowledge) from \u0027ἐπίσταμαι\u0027 (i know) + \u0027-λογία\u0027 (discourse) from \u0027λέγω\u0027 (i speak) The term was introduced into English by the Scottish philosopher James Frederick Ferrier (1808-1864).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of philosophy dealing with the study of knowledge; theory of knowledge, asking such questions as \u0026quot;What is knowledge?\u0026quot;, \u0026quot;How is knowledge acquired?\u0026quot;, \u0026quot;What do people know?\u0026quot;, \u0026quot;How do we know what we know?\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Some thinkers take the view that, beginning with the work of Descartes, \u0027\u0027epistemology\u0027\u0027 began to replace metaphysics as the most important area of philosophy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"location\u003dLondon|date\u003d12 April page\u003dR10|passage\u003d[P]hilosophers of the time [early 20th century] were primarily concerned with \u0027\u0027epistemology\u0027\u0027 and the foundations of the sciences; they often spoke as if we were separated from the real world by a screen of \u0026quot;representations\u0026quot; or \u0026quot;sense-data\u0026quot;; they tended to regard our approach to the world as one of disinterested observation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A particular theory of knowledge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In his \u0027\u0027epistemology\u0027\u0027, Plato maintains that our knowledge of universal concepts is a kind of recollection\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I believe that \u0027intuitionism\u0027 is usually, and rightly, taken to mean Brouwer\u0027s \u0027\u0027epistemology\u0027\u0027 of mathematics, which is unrelated to the origin or content of topos theory\", \"priority\":6}]}, \"synonyms\":{}}");

