	add("epitasis", "{\"term\":\"epitasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἐπίτασις\u0027 (stretching) from \u0027ἐπιτείνω\u0027 (to stretch) from \u0027ἐπί\u0027 + \u0027τείνω\u0027 (stretch)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The second part of a play, in which the action begins\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The addition of a concluding sentence that merely emphasizes what has already been stated\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The period of violence in a fever or disease; paroxysm\", \"priority\":3}]}, \"synonyms\":{}}");

